import React from "react";

const DeleteStudent = () => {
  const styles = {
    container: {
      display: "flex",
      flexDirection: "column",
      justifyContent: "center",
      alignItems: "center",
      height: "50vh",
    },
  };
  return (
    <div style={styles.container}>
      <input
        style={{
          padding: 10,
          borderRadius: 10,
          margin: 10,
          fontSize: 18,
          fontWeight: "600",
          color: "steelblue",
          border: "2px solid grey",
        }}
        placeholder="Enter Student Name"
      />

      <input
        style={{
          padding: 10,
          borderRadius: 10,
          margin: 10,
          fontSize: 18,
          fontWeight: "600",
          color: "steelblue",
          border: "2px solid grey",
        }}
        placeholder="Enter Student Class"
      />
    </div>
  );
};

export default DeleteStudent;
